bool CppAdvanceParser::postfixExpressionSempred(PostfixExpressionContext *_localctx, size_t predicateIndex) {
  switch (predicateIndex) {
    case 10: return precpred(_ctx, 9);
    case 11: return precpred(_ctx, 8);
    case 12: return precpred(_ctx, 4);
    case 13: return precpred(_ctx, 2);
    case 14: return precpred(_ctx, 1);

  default:
    break;
  }
  return true;
}

void CppAdvanceParser::initialize() {
#if ANTLR4_USE_THREAD_LOCAL_CACHE
  cppadvanceparserParserInitialize();
#else
  ::antlr4::internal::call_once(cppadvanceparserParserOnceFlag, cppadvanceparserParserInitialize);
#endif
}
